import React, { useEffect, useState } from "react";
import { makeStyles } from "@material-ui/styles";
import {
  Button,
  TextField,
  FormControl,
  Radio,
  RadioGroup,
  FormControlLabel,
  FormLabel,
} from "@material-ui/core";
import { Link } from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  formControl: {
    margin: 3,
  },
}));

export function AmiiboCharacter({ match }) {

  console.log(match);

  const classes = useStyles();
  const [caracterer, setCaracter] = useState()

  useEffect(() => {
    fetch(`https://www.amiiboapi.com/api/amiibo?id=${match.params.id}`).then(
      (response) =>
        response.json().then(data => {
            setCaracter(data.amiibo)
            console.log(data);
        })
    );
  }, []);

  return(
      <div style={{width: '50%', marginLeft: 'auto', marginRight: 'auto'}}>
          <h2>Amiibo Edition</h2>

          <p>
              <TextField id='name' value={caracterer.name} defaultValue='none' fullWidth='true' label='Name' variant='outlined'/>
          </p>
      </div>
  )
}
